import React, { Component } from "react";
import HumanScore from "./HumanScore";
import ComputerScore from "./ComputerScore";

export default class Score extends Component {
  render() {
    return (
      <Row>
        <HumanScore></HumanScore>

        <ComputerScore></ComputerScore>
      </Row>
    );
  }
}
